/* Model creation/destruction functions */

void MODEL_mkFSMTestbench::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkFSMTestbench_instance = new MOD_mkFSMTestbench(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkFSMTestbench_instance->INST_dut_adder_inputFIFO.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_adder_outputFIFO.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_mul_inputFIFO.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_mul_outputFIFO.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_sqrt_inputFIFO.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_sqrt_outputFIFO.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_incoming.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_start_wire.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_start_reg_2.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_abort.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_state_set_pw.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_state_overlap_pw.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_dut_state_fired_1.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_start_wire.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_start_reg_2.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_abort.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_state_set_pw.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_state_overlap_pw.set_clk_0)("CLK");
  (mkFSMTestbench_instance->INST_state_fired_1.set_clk_0)("CLK");
  (mkFSMTestbench_instance->set_clk_0)("CLK");
}
void MODEL_mkFSMTestbench::destroy_model()
{
  delete mkFSMTestbench_instance;
  mkFSMTestbench_instance = NULL;
}
void MODEL_mkFSMTestbench::reset_model(bool asserted)
{
  (mkFSMTestbench_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkFSMTestbench::get_instance()
{
  return mkFSMTestbench_instance;
}

