/* VCD dumping functions */
MOD_mkFSMTestbench & mkFSMTestbench_backing(tSimStateHdl simHdl)
{
  static MOD_mkFSMTestbench *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkFSMTestbench(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkFSMTestbench::dump_VCD_defs()
{
  (mkFSMTestbench_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkFSMTestbench::dump_VCD(tVCDDumpType dt)
{
  (mkFSMTestbench_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkFSMTestbench_backing(sim_hdl));
}
